def count_non_intersecting_segments(test_cases):
    results = []
    for case in test_cases:
        N = case[0]
        A = case[1]
        if len(set(A)) != N:
            n = N + 2
            result = n * (n - 1) * (n - 2) * (n - 3) // 24
            results.append(result)
            continue
        counter = 0
        for i in range(N - 1):
            dic = {}
            for j in range(i, N - 1):
                if A[j] in dic:
                    dic[A[j]] += 1
                else:
                    dic[A[j]] = 1
                for p in range(j + 1, N):
                    if A[p] in dic:
                        continue
                    for q in range(p, N):
                        if A[q] in dic:
                            break
                        counter += 1
        results.append(counter)
    return results

